// import Head from "./components/Head";
import Title from "./Title";
import ListContent from "./ListContent";
import InputContent from "./InputContent";
import Navbar from "./Navbar";

function HomePage() {
  return (
    <>
      <Navbar />
      <Title />
      <InputContent />
      <ListContent />
    </>
  );
}

export default HomePage;
